import React from "react";
import "./style/index.scss";
import Footer from "./components/footer-template/index.js";
import { Link } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>daBus Hawaii</p>
        <p>coming soon...</p>
        <Link to="">Trip Planner</Link>
      </header>
      <Footer></Footer>
    </div>
  );
}

export default App;
